import React from 'react';
import C from './MyPosts.module.css'
const MyPosts = () => {
    return (
        <article className={C.article}>
            <div>my posts
          <div>new post</div>
                <div className={C.posts}>
                    <div className={`${C.item} ${C.active}`}>post1</div>
                    <div className={C.item}>post2</div>
                </div>
            </div>
        </article>
    )
}

export default MyPosts;
